Bali, Indonesia, 11 December 2021 – The Bali Process on People Smuggling, Trafficking in Persons and Related Transnational Crime (Bali Process) will hold its 13th Plenary Meeting from 13 to 15 December 2021. The meeting will be held in hybrid format, with participants attending in person and virtually.

The Plenary Meeting will be co-chaired by the Republic of Indonesia and the Republic of the Philippines. The meeting will be attended by representatives from the Bali Process Member States, as well as representatives from international organizations and civil society.

The Plenary Meeting will focus on a range of issues including:

- Saving the world’s remaining forests and sharing technologies to help developing nations grow in less-polluting ways;

- Strengthening cooperation to combat human trafficking and smuggling of migrants;

- Enhancing cooperation to combat corruption and money laundering;

- Strengthening cooperation to combat terrorism and violent extremism;

- Strengthening cooperation to combat cybercrime;

- Strengthening cooperation to combat wildlife trafficking;

- Strengthening cooperation to combat illicit trade in cultural goods;

- Strengthening cooperation to combat illicit trade in small arms and light weapons;

- Strengthening cooperation to combat illicit trade in narcotics and psychotropic substances;

- Strengthening cooperation to combat illicit trade in counterfeit goods;

- Strengthening cooperation to combat illicit trade in endangered species;

- Strengthening cooperation to combat illicit trade in cultural goods;

