The Plenary Meeting will also include a Ministerial Session on 14 December, which will be attended by Ministers from Bali Process Member States. The Ministerial Session will focus on strengthening regional and international efforts against human trafficking, smuggling of migrants, corruption, money laundering, terrorism, violent extremism, cybercrime, wildlife trafficking, illicit trade in cultural goods, illicit trade in narcotics and psychotropic substances, counterfeit goods, endangered species, cultural heritage trafficking and illegal logging.

The Bali Process was established at the Third Ministerial Conference on People Smuggling, Trafficking in Persons and Related Transnational Crime held in Bali, Indonesia on 29 November 2003. The Bali Process is a regional initiative that brings together governments from across the Asia Pacific region and beyond with the aim of combating human trafficking, smuggling of migrants and related transnational crime. The Bali Process is supported by the United Nations Office on Drugs and Crime (UNODC) as a key mechanism for regional collaboration against these crimes.

